Information
------------------------------

This Is Life with Lisa Ling 
In &quot;This Is Life&quot;, award-winning journalist and author Lisa Ling takes us on a gritty, breathtaking journey to far corners of America. Here, Ling introduces us to sub-cultures and communities that are unusual, extraordinary and sometimes dangerous; often getting people to share things that they haven't shared with their closest friends or even family members. Each episode, in the eight-part series, gives a raw and honest look into unconventional lifestyles that exist in our own backyard.


1)  Sugar Daddies Sugar Babies 
In the last decade, a host of websites have sprung up with a mission to match wealthy older men with young, attractive women, and for both parties, it can be an alluring opportunity. This Is Life with Lisa Ling will dive into this world of youth, beauty, money and sex as Ling asks questions of Sugar Daddies and Sugar Babies alike: Why did you choose this lifestyle? Once you get deep into this world, can you ever go back to conventional relationships? And what are the true costs and benefits when sex, money and power are on the line?

2)  Unholy Addiction 
Utah, home of The Church of Jesus Christ of Latter-day Saints, has the lowest rates of tobacco use and alcohol-related deaths in the nation. Yet, every year more people in Utah are dying from prescription drug overdoses than are dying in car accidents. In this episode, Lisa travels to Salt Lake City to discover how the hard hit LDS Church is battling an epidemic that is wreaking havoc on its faithful followers.

3)  The Genius Experiment 
Lisa examines the question- can we manufacture genius; a genius sperm bank created by eccentric millionaire and businessman Robert Graham has produced 200 progeny in their 20s and 30s in hopes of being created more intelligent than their peers.

4)  Filthy Rich 
Lisa explores America's new Wild West as a new wave of women pioneers are making names for themselves as a Western North Dakota oil boom is responsible for the unemployment rate being less than one percent.

5)  Jungle Fix 
Lisa goes inside the hidden, mystical world of Ayahuasca, and investigates the popularity of this unregulated form of self-exploration, the power and consequences that can come along with its ingestion.

6)  Road Strip 
Lisa takes a road &quot;strip&quot; with four traveling dancers, each of whom has left home for more lucrative or entertaining prospects in Internet-located stripping spots.

7)  Gay Rodeo 
The image of the American cowboy is tough, self reliant, stoic and the epitome of masculine; Lisa explores the world of the Gay Rodeo Association having over 5,000 registered members and about 200 core competitors who prove that cowboys can be gay.

8)  Called to the Collar 
Lisa travels to the Midwest, where more Catholic men are being drawn to the priesthood than anywhere else in the county, in a time where the Catholic population is on the rise, but the number of Catholic priests is dwindling.

